import React from "react";
import { Link } from "react-router-dom";
import "../css/navbar.css";
const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg">
      <div className="container-fluid">
        
          <Link to="/anasayfa" className="navbar-brand"> Yeni İmaj </Link>
        <div className="collapse navbar-collapse" id="navbarTogglerDemo03">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link to="/fatura" className="nav-link active" aria-current="page" href="#">
                Fatura
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/tahsilat" className="nav-link active" href="#">
                Tahsilat
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/muhasebe" className="nav-link active">
                Muhasebe
              </Link>
            </li>
          </ul>
         
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
